import React from 'react';
import "../../Css/Project.css"

const Project = ({ project}) => (
  <div classname="project" >
     {project.map(pro =>(
            <div  key={pro._id}>
                  <h2 className="projectTitle">{pro.projectTitle}</h2>
                  <h4 className="projectDescription">{pro.projectDescription}</h4>
                  <h4 className="projectSkills">{pro.projectSkills}</h4>
                  <h4 className="projectBudget">{pro.projectBudget}</h4>            
            </div>
         ))}
  </div>
);


export default Project;
